import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialScreenshot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialScreenshot });
    screenshots.push(initialScreenshot);

    // Wait for at least one product price to be visible
    // Try .product-price (from CSS), fallback to text selector for $ sign
    let priceSelectors = [
      '.product-price',
      '//div[contains(@class,"product-price")]', // XPath
      '//div[contains(text(), "$") or contains(text(), "USD")]',
      '//span[contains(@class,"product-price")]',
      '//span[contains(text(), "$")]'
    ];
    let found = false;
    for (let sel of priceSelectors) {
      try {
        if (sel.startsWith('//')) {
          await page.waitForSelector(`xpath=${sel}`, { timeout: 2000 });
        } else {
          await page.waitForSelector(sel, { timeout: 2000 });
        }
        found = true;
        break;
      } catch (e) { /* try next */ }
    }
    if (!found) {
      throw new Error('No product price elements found');
    }

    // Extract all product prices
    // Use all .product-price elements, fallback to $ regex scan if none
    let prices = await page.$$eval('.product-price', nodes =>
      nodes.map(n => n.textContent.trim()).filter(Boolean)
    );

    // If not found, fallback: scan all text nodes for $NN.NN pattern
    if (!prices.length) {
      prices = await page.$$eval('body *', nodes => {
        const priceRegex = /\$\s*\d{1,3}(?:,\d{3})*(?:\.\d{2})?/g;
        let found = [];
        for (let n of nodes) {
          if (n.childElementCount === 0 && n.textContent && priceRegex.test(n.textContent)) {
            let matches = n.textContent.match(priceRegex);
            if (matches) found.push(...matches.map(s => s.trim()));
          }
        }
        return found;
      });
    }

    // Remove duplicates and sort for consistency
    prices = [...new Set(prices)].sort();

    // Take screenshot after extraction
    const pricesScreenshot = path.join(screenshotsDir, 'step_2_prices_found.png');
    await page.screenshot({ path: pricesScreenshot });
    screenshots.push(pricesScreenshot);

    return {
      success: true,
      action: "Extracted all product prices from the page",
      extractedData: {
        productPrices: prices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
